// SPDX-License-Identifier: BSD-2-Clause
pragma solidity ^0.8.16;

contract CountByX {

  function countBy(int x, int n) public pure returns (int[] memory) {
    int[] memory z = new int[](uint(n));
    // TODO: Your code here   
     
    for (uint i=0;i<uint(n);i++) {
        z[i]=int(i)* x;
    }  
    return z;
  }
}

